def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if ratios[i] < 0.3:
            priorities[i] = np.power(np.sin(item) + np.cos(bins[i]), 2) * item
        elif ratios[i] >= 0.3 and ratios[i] < 0.5:
            priorities[i] = np.tan(item) * np.tan(bins[i]) + np.log(item + bins[i] + 1)
        elif ratios[i] >= 0.5 and ratios[i] < 0.7:
            priorities[i] = np.sqrt(np.abs(item - bins[i]) + 1) + np.arctan(item - bins[i])
        else:
            priorities[i] = np.cosh(np.exp(ratios[i])) * np.tanh(np.sqrt(ratios[i])) - np.log(ratios[i] + 1) + item

    for j in range(len(bins)):
        if priorities[j] < 15:
            priorities[j] *= 2
        elif priorities[j] >= 15 and priorities[j] < 25:
            priorities[j] *= 1.5
        elif priorities[j] >= 25 and priorities[j] < 35:
            priorities[j] /= 1.5
        else:
            priorities[j] = np.sqrt(priorities[j]) + item

    for k in range(len(bins)):
        if priorities[k] % 3 == 0:
            priorities[k] += item
        else:
            priorities[k] -= item / 3

    return priorities
